import React, { Component } from 'react'

export default class Main extends Component {
    render() {

        const {currentNote} = this.props
       
            if(!currentNote == false) {
                return (
                    <div className="main">
                    <h1>No notes</h1>
                </div>
                )
            } else {
                return (
                    <div className="main">
                    <h1>notes</h1>
                </div>
                )
            }
           
        
    }
}
